#첫번째기록 #1st #record #question #diary 

Q. 당신은 지금 행복한가요?

행복이라는 것은 정말 멀리 있어서 동경만 하는 어려운 존재인 듯 싶다가도 어느 순간 일상 속 사소한 일들에서 찾아볼 수 있는 아주 가깝고 친숙한 존재이기도 하다.

그래서 나는 여태까지 왜 나는 불행할까? 왜 나만 이렇게 괴롭고 아파야만 할까? 라는 불평을 하며 비관적으로 살았었다. 그랬기에 남 탓은 시도 때도 없이 해대면서, 나 자신이 무슨 잘못을 저질러 남에게 상처를 줬는지 혹은 나 자신이 어떤 걸 할 때 가장 즐거운지...이런 나 자신을 돌아보며 아껴주는 그런 태도는 다 잊어버리고 살았다.

원래 나는 생각이 심해 바다 마냥 깊고 심해 아귀처럼 혼자서도 잘 지내는 아이였는데, 점점 그게 너무 깊어지다보니 땅 속에 처박힌 돌멩이처럼 내 본연의 색을 잃어버린 것 같다. 그게 내 잘못이었건, 남들이 던진 화살을 맞아서였건... 너무 꽉 막히고 답답하게 살면서 아무렇지 않게 남에게 상처를 줘놓고 내가 상처를 받는 건 기본 2주는 마음에 담아두면서 살아온 것이다. 결과적으로는 남들에게도 상처를 많이 주었지만, 나 자신에게 가장 해로운 악습이었던 것이 현실이다.

내가 어떤 큰 결정을 망설일 때 누군가 그랬다. 너 자신을 먼저 돌아보고 사랑하라고. 왜 남에게는 그렇게 겁을 내고 두려워하면서 정작 네 자신은 아무렇지 않게 미워하냐고. 난 그 당시에는 그 말 뜻을 전혀 이해할 수도 없었고 하고 싶지도 않았다. 내가 왜 그런 이상한 말을 들어야되지 싶어 더 비틀렸다. 러브마이셀프야 뭐야... 교과서도 아니고, 평소에 내가 정말 극도로 혐오하던 사람이 그런 말을 하니까. 꼭 요즘 말로 흔히 일컫는 꼰대가 하는 소리인 줄 알고 넘겼다.

그렇지만 이렇게 많은 시간이 흐르고 내 자신을 돌아보며, 반성하며 뉘우치고 또 날 사랑해주고 아껴주다 보니. 이제야 알겠다.

ㅡ
나는 지금 행복하다.
정말 진심으로 행복하다.
한 순간에 지나갈 행복감이라 할지라도 난 그에 만족한다.
ㅡ

한 순간에 지나갈 행복이라면
그다지 깊고 소중한 행복도 아닐 것이라고 짐작하고 나를 아프게 하는 쓸 데 없는 것들은 흘려버리고,
나를 성장하게 해 주는 감사한 행복들은 놓치지 않으려 애쓰며 하루하루 감사하고 보람차게, 떳떳하게 지낸다면 바로 그게 진정한 행복이 아닐까?

'나는 흐르는 강물' 처럼 살고 있고, 앞으로도 그러고 싶다.

